def get_value_for_world_views_of_type_drawer(case: World) -> Union[set, list, Drawer]:
    """Give Conclusion for World.views. Possible types are a list/set of: Drawer"""
    return [Drawer(fc.child, fc.parent) for fc in case.connections if isinstance(fc, FixedConnection)
            and isinstance(fc.parent, Container) and isinstance(fc.child, Handle)]
return get_value_for_world_views_of_type_drawer(case)

def get_value_for_world_views_of_type_cabinet(case: World) -> Union[Cabinet, set, list]:
    """Give Conclusion for World.views. Possible types are a list/set of: Cabinet"""
    drawers = [v for v in case.views if isinstance(v, Drawer)]
    prismatic_connections = [conn for conn in case.connections if type(conn) is PrismaticConnection]
    cabinets = []
    for pc in prismatic_connections:
        for drawer in drawers:
            if isinstance(pc.parent, Container) and pc.child.name == drawer.container.name:
                current_cabinets_containers = [v.container.name for v in case.views if isinstance(v, Cabinet)]
                if pc.parent.name not in current_cabinets_containers:
                    cabinets.append(Cabinet(pc.parent, [drawer]))
                else:
                    existing_cabinet = \
                        [v for v in case.views if isinstance(v, Cabinet) and v.container.name == pc.parent.name][0]
                    if drawer not in existing_cabinet.drawers:
                        existing_cabinet.drawers.append(drawer)

    return cabinets
return get_value_for_world_views_of_type_cabinet(case)
